import React from 'react'
import SocialLogin from 'react-social-login';


function SocialLoginButton(WrappedComponent: any) {
    const { children, triggerLogin, ...otherProps } = WrappedComponent.props;

    return (
        <WrappedComponent onClick={triggerLogin} {...otherProps}>
            {children}
        </WrappedComponent>
    );

}
export default SocialLogin(SocialLoginButton);
